releaseNotes:
After installing the package, add the following lines (except titles within brackets) to your projects' Startup.cs file:

(Namespace)
@using Proagrica.ComponentLibrary.Navbar;

(Services)
public void ConfigureServices(IServiceCollection services)
{
     services.AddRazorPages().AddRazorRuntimeCompilation();
     NavbarExtensions.AddNavbarViews(services);
}

(Configuration)
public void Configure(IApplicationBuilder app, IWebHostEnvironment env)
{
     NavbarExtensions.UseNavbarAssets(app);
}

Then you can use the view components in the consuming projects' views like this:

@await Component.InvokeAsync("NavbarComponent", new { theme = "proagrica" })
